window.bookSummaryJSON = "<p>En route to London from New York, Flight 305 suddenly loses power and crash-lands in the English countryside, plunging a group of strangers into a mysterious adventure that will have repercussions for all of humankind. </p> <p>Struggling to stay alive, the survivors soon realize that the world they've crashed in is very different from the one they left. But where are they? Why are they here? And how will they get back home? </p> <p>Five passengers seem to hold clues about what's really going on: writer Harper Lane, venture capitalist Nick Stone, German genetic researcher Sabrina Schr√∂der, computer scientist Yul Tan, and Grayson Shaw - the son of a billionaire philanthropist. </p> <p>As more facts about the crash emerge, it becomes clear that some in this group know more than they're letting on - answers that will lead Harper and Nick to uncover a far-reaching conspiracy involving their own lives. As they begin to piece together the truth, they discover they have the power to change the future and the past - to save our world...or end it. </p> <p>To read an epilogue to <i>Departure</i> and access other bonus material, go to agriddle.com/departure/extras </p>"; 
